import React from "react";

const Paginado = ({pokemonesPorPagina,allPokemons,paginado}) =>{

    const numPag = []

    for (let i = 1; i <= Math.ceil(allPokemons / pokemonesPorPagina); i++){
        numPag.push(i)
    }

    return(
        <nav>
            <ul>
                {numPag && numPag.map(numero => {
                        return(
                        <section  
                            key={numero}
                        >

                        <button onClick={() => paginado(numero)}>{numero}</button>
                          
                        </section>
                        )
                    })
                }
            </ul>
        </nav>
    )


};

export default Paginado;
